import React, { Component } from 'react';
import DashboardNav from '../../components/nav/DashboardNav';
import SearchBar from '../../components/searchBar/SearchBar';
import Charts from '../../components/charts/Charts';

class Dashboard extends Component{
    state={
        charts:[
            {
                title:'name',
                date:'01-08-2020',
                data:[1,2,3,4,5]
            },
            {
                title:'name',
                date:'01-08-2020',
                data:[1,2,3,4,5]
            }
        ]

    }

    render(){
        return(
            <div style={styles.container}>
                <DashboardNav/>
                <section style={styles.content}>
                    <SearchBar/>
                    <div style={styles.content}>
                        <h1>Dashboard</h1>
                        <Charts title={this.state.charts.title} date={this.state.charts.date} data={this.state.charts.data}/>
                     </div>
                </section>
            </div>
            // search box
            // content
        )
    }

}

export default Dashboard;

const styles ={
    container:{
        color:'red',
        display:'flex',
        backgroundColor:'black',
        flexDirection:'row',
        // alignItems:'center',
        height:'100vh',
        // opacity: '0.8',
    },

    content:{
        width:'100%',
        marginLeft:'1%'
        // padding:''
    }
}
